import React, { Component } from "react";
import Productos from "./componentes/Productos";
import Layout from "./componentes/Layout";
import Title from "./componentes/Title";
import Navbar from "./componentes/Navbar";
//import "./App.css";¨

import "./main.css";

class App extends Component {
  state = {
    productos: [
      {
        name: "Tomate",
        price: 1500,
        img: "/imgs/tomate.jpg",
      },

      {
        name: "Arebejas",
        price: 2500,
        img: "/imgs/arbejas.jpg",
      },

      {
        name: "Lechuga",
        price: 500,
        img: "/imgs/lechuga.jpg",
      },
    ],

    carro: [
      //{ name: "Tomate", price: 1500, img: "/imgs/tomate.jpg", cantidad: 1 },
    ],
  };



  render() {
    return (
      <div>
        <Navbar />
        <Layout>
          <Title empresa="INTEL" edad="19" nombre="Carlos" />
          <Productos
            agregarAlcarro={() => console.log("agregando...")}
            productos={this.state.productos}
          />
        </Layout>
      </div>
    );
  }
}

export default App;
